            'PQ.About': 'Questa analisi copre deviazione di tensione, squilibrio di tensione, deviazione di frequenza e squilibrio di corrente. La deviazione di tensione è calcolata come (U−Un)/Un×100%; la deviazione di frequenza come |f−fn|; lo squilibrio trifase come max(|Xi−Xavg|)/Xavg×100%, richiedendo allineamento temporale dei canali trifase. I risultati si basano sulle serie temporali del contatore selezionato nel periodo di report. Se mancano canali trifase o i timestamp non sono allineati, gli indicatori di squilibrio vengono saltati. Picchi transienti o campionamenti mancanti possono amplificare i valori peggiori; per valutazioni a regime stazionario si consiglia di fare riferimento a indicatori statistici come tasso di conformità e P95.',
